```sparql
SELECT ?creature WHERE {
 ?creature a ns1:Beast ;
          ns1:hasAlignment ns1:ChaoticGood .
 FILTER NOT EXISTS { ?creature ns1:hasLanguages ns1:Draconic }
}
```

This query first selects all creatures with Chaotic Good alignment and then uses `FILTER NOT EXISTS` to exclude those who have Draconic listed as one of their languages.

