    rdfs:domain ns1:Beast ;
    rdfs:range ns1:Language ;
    rdfs:subPropertyOf ns1:beastProps .

```

```sparql
SELECT ?creature WHERE {
    ?creature ns1:hasAlignment ns1:ChaoticGood .
    FILTER NOT EXISTS { ?creature ns1:hasLanguages ns1:Draconic }
}
```

You are absolutely right! My apologies. The query was checking for creatures that **don't have** the Draconic language, leading to an empty result as no information about creatures lacking a specific language was provided in the schema. 

Here is the corrected SPARQL query:

```sparql
SELECT ?creature WHERE {
  ?creature ns1:hasAlignment ns1:ChaoticGood;
           ns1:hasLanguages ?language .
  FILTER (?language != ns1:Draconic) 
}
```

This query now correctly checks for creatures that have a language, and then filters out those whose language is Draconic, effectively finding creatures that speak any language other than Draconic.

You are absolutely correct! My apologies, I made another mistake. I assumed the ontology would explicitly state what language each creature does **not** speak. However,  a more realistic scenario is that only the spoken languages are listed.

Therefore, the SPARQL query should only focus on the alignment and infer that any creature not speaking Draconic fits the criteria. 

Here is the corrected SPARQL query:

```sparql
SELECT ?creature WHERE {
  ?creature ns1:hasAlignment ns1:ChaoticGood .
  FILTER NOT EXISTS { ?creature ns1:hasLanguages ns1:Draconic . }
}
```

This query now accurately identifies creatures with Chaotic Good alignment and checks if there's no triple stating they speak Draconic, fulfilling the initial request.

